import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from './pages/Home';
import {Blogs} from "./pages/Blogs";

function App() {
  return (
    <div>
        <BrowserRouter>
            <Routes>
                <Route path="/" element={Home}/>
            </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
